import React from 'react';
import Link from 'next/link';

const NoticeList = (props) => {

    const lists = props.props;

    return(
    <>
        <div>
            {lists && lists.map(list => (
                <>
                    <li props={list} key={list.NTC_ID}>{list.NTC_TITLE}</li>
                </>
            ))}
        </div>
    </>
    )

};

export default NoticeList;
